import React from 'react';

import { CustomButtonContainer } from './custom-button.styles';
import './custom-buttom.styles.scss';

const CustomButton = ({
  children,
  ...props
}) => (
  <CustomButtonContainer {...props}>
    {children}
  </CustomButtonContainer>
);

export default CustomButton;
